To decide if S ⇒* t34 t13 t22, we run a CYK parse on “t34 t13 t22”:

1) Initialize size‐1 spans with all nonterminals A such that A→terminal matches:

  pos1=”t34”: {NT0, NT4}  
  pos2=”t13”: {NT0, NT5}  
  pos3=”t22”: {NT6}  

2) Build length‐2 spans:

  span [1–2], pairs from {NT0,NT4}×{NT0,NT5}:  
    only NT5→NT0 NT5 applies → {NT5}

  span [2–3], pairs from {NT0,NT5}×{NT6}:  
    no A→B C matches → ∅

3) Build length‐3 span [1–3]:

  split at k=1: [1–1]×[2–3] has ∅  
  split at k=2: [1–2]={NT5}×[3–3]={NT6}  
    no A→NT5 NT6 in the grammar  

Thus the root cell [1–3] is empty and S∉[1–3]. The grammar does not generate t34 t13 t22.

No

To decide membership, we run the CYK algorithm over the 4‐token string w = t23 t24 t5 t29.  Labeling positions 1…4:

1. Length‐1 spans:
   1: t23 ⇒ {NT2, NT3, NT4, NT5}
   2: t24 ⇒ {NT0, NT3}
   3: t5  ⇒ {NT4}
   4: t29 ⇒ {NT3, NT4, NT6}

2. Length‐2 spans:
 (1–2): no binary rule applies ⇒ ∅
 (2–3): no binary rule applies ⇒ ∅
 (3–4): combining {NT4}×{NT3,NT4,NT6}, the pair (NT4,NT6) matches NT6→NT4 NT6 ⇒ {NT6}

3. Length‐3 spans:
 (1–3): splits into (1–1)+(2–3) or (1–2)+(3–1), both involve an empty cell ⇒ ∅
 (2–4): split (2–1)+(3–2) = {NT0,NT3}×{NT6}.  NT2→NT3 NT6 fires ⇒ {NT2}

4. Length‐4 span (1–4): split (1–1)+(2–3) gives {NT2,NT3,NT4,NT5}×{NT2}.  The pair (NT5,NT2) matches S→NT5 NT2 ⇒ {S}.

Since S ∈ cell (1,4), the grammar generates the string.  
Yes

We can apply the CYK‐table method.  First note which nonterminals produce each single terminal in the string “t29 t23 t14 t24 t20 t31 t27”:

Position 1 (t29) → {NT3, NT4, NT6}  
Position 2 (t23) → {NT2, NT3, NT4, NT5}  
Position 3 (t14) → {NT0}  
Position 4 (t24) → {NT0, NT3}  
Position 5 (t20) → {NT3}  
Position 6 (t31) → {NT0}  
Position 7 (t27) → {NT0, NT2, NT3}

Next, for spans of length 2 up to 7, we look for any binary rule A→BC such that B occurs in the left subspan’s set and C occurs in the right subspan’s set.  One checks:

– For every adjacent pair (span=2), no binary rule’s left‐and‐right nonterminals both appear in those two 1‐spans.  
– Hence no new nonterminal ever appears in any larger span.  
– In particular, S never appears over the full span 1..7.

Since S cannot be built for any split of the 7‐symbol string, the grammar does not generate it. 

No

We fill in the CYK table for the 8‐token input.  After computing all length = 1 entries from the terminal productions, and then building up length = 2…7 chunks via the binary rules, one finds in particular

– T[3, 6] = { NT2 }  
– T[2, 7] = { S }  
– finally T[1, 8] contains S via the split (NT5, NT2) → S.  

Hence S ⇒* t31 t13 t1 t30 t31 t31 t23 t22, so the answer is:

Yes

Here is a brief sketch of the CYK‐table fill (only nonempty cells shown):

Positions 1…10: t24 t14 t24 t24 t27 t6 t27 t6 t13 t4  
X[i,1]:
1:{NT3,NT0} 2:{NT0} 3:{NT3,NT0} 4:{NT3,NT0}  
5:{NT2,NT3,NT0} 6:{NT0} 7:{NT2,NT3,NT0} 8:{NT0}  
9:{NT0,NT5} 10:{NT2,NT4}

Length=2: X[8,2]={NT5}, X[9,2]={S}  
3: X[7,3]={NT4,NT5}, X[8,3]={S}  
4: X[6,4]={NT5}, X[7,4]={S}  
5: X[5,5]={NT4,NT5}, X[6,5]={S}  
6: X[4,6]={NT5}, X[5,6]={S}  
7: X[3,7]={NT5}, X[4,7]={S}  
8: X[2,8]={NT5}, X[3,8]={S}  
9: X[1,9]={NT5}, X[2,9]={S}  
10: X[1,10]={S}

Since S ∈ X[1,10], the grammar does generate the string.  
